  true,\n\t\"url\": null,\n\t\"notes\": \"This file can be used as a tool to append
  geographic codes to geocoded point data. The file was developed by Pitt's Center
  for Social and Urban Research and provides the county, census tract, county subarea/municipality,
  Allegheny County Council District, PA House and Senate District numbers, school
  district, and Zip codes. Also included from the City of Pittsburgh: neighborhoods,
  wards, City Council election districts, and City administrative boundaries, including
  Permits Licenses and Inspection administrative zones, Public Works administrative
  zones, Fire districts, and Police zones. The file contains data from Allegheny,
  Armstrong, Beaver, Butler, Fayette, Greene, Indiana, Lawrence, Washington, and Westmoreland
  Counties in Pennsylvania.\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
